import React from 'react';

const SessionManager = ({ onCreateSession }) => {
  const handleCreateSession = async () => {
    onCreateSession();
  };

  return (
    <div>
      <button onClick={handleCreateSession}>Create Session</button>
    </div>
  );
};

export default SessionManager;
